"""##¿El conjunto de datos es multivariado? (multivariate)

Para determinar si nuestro conjunto de datos es multivariado, necesitamos hacer
una revisión de la calidad de los datos que contien cada columna. Después de la exploración inicial y la evaluación de consistencia, tenemos identificadas las columnas que tienen variables que nos podrían ocasionar conflictos.

Comenzamos con la columna 'km'

Esta tiene 99% de valores con la variable 0. Esto puede significar dos cosas, que realmente la información representa el kilometro 0 de las vías o que se usa el 0 como un valor para indicar que no se conoce el dato real.
"""

conteo = (df_consistente['km'] == 0).sum()  # Contar los valores 0
print(f"El total de registros 0 es {conteo}")
print(f"El % de registros 0 es {round(conteo/15301,2)}")

"""La persistencia del registro 'S/D' en varias columnas sabemos que significa 'Sin Descripción'. Queremos saber la trascendencia que tendrá esto en la información que ofrece cada columna, ya que si bien, no tenemos registros 'NaN', este registo no aporta ninguna información sobre el dato que representa cada atributo.

Vamos a revisar las columnas en las que se encuentran registros 'S/D' y cuantificar el número de estos registros en el total.
"""

# Creo un diccionario para almacenar los resultados
conteo_sd_dict = {}

# Bucle para contar cuántas veces aparece 'S/D' en cada columna y almacenar en el diccionario
for col in df_consistente.columns:
    conteo = (df_consistente[col] == 'S/D').sum()  # Contar 'S/D' en la columna
    if conteo > 0:  # Solo guardar columnas con al menos una coincidencia
        conteo_sd_dict[col] = conteo

#print(conteo_sd_dict)

for columna, conteo in conteo_sd_dict.items():
    print(f"{columna}: {conteo} El % de registros 'S/D' es: {round(conteo/15301,2)}")

"""La revisión nos dice que todas las columnas donde aparece el registro 'S/D' supera el 10%, esto nos puede ocasionar problemas al tratar de obtener información de estos valores.

Por último, tenemos información de coordenadas x,y. Revisaremos qué información nos ofrecen estas columanas y verificaremos su ubicación y la cantidad de veces que se repite el mismo punto.
"""

# Unir las columnas 'x' e 'y' en una nueva columna 'coordenadas'
df_consistente['coordenadas'] = list(zip(df_consistente['x'], df_consistente['y']))

# Contar cuántas veces se repiten las combinaciones de coordenadas
conteo_coordenadas = df_consistente['coordenadas'].value_counts()

# Convertir a diccionario (opcional)
conteo_coordenadas_dict = conteo_coordenadas.to_dict()

