puntos = gpd.read_file('/content/drive/MyDrive/DATA/accidentes_santa_fe_v2.geojson')  # Archivo con puntos
poligonos = gpd.read_file('/content/drive/MyDrive/DATA/santa_fe.geojson')  # Archivo con polígonos

# Asegúrate de que ambos GeoDataFrames tengan el mismo sistema de referencia
puntos = puntos.set_crs(poligonos.crs, allow_override=True)

